import React from "react";

function ResumeTitle(){
	return(
		<div className="resume-title-m sm:border-none">
			<h1 className="md:text-purple-600 text-teal-600 sm:text-green-500 sm:text-6xl">More About Me</h1>
			<div className="resume-title-sm lg:bg-purple-600 md:bg-purple-900"></div>
		</div>
	)
}

export default ResumeTitle;
